      <form className="login__form" name="login" onSubmit={handleSubmit}>
        <input
          type="email"
          className="login__input"
          placeholder="Email"
          value={email}
          onChange={handleEmailChange}
        />
        <input
          type="password"
          className="login__input"
          placeholder="Пароль"
          value={pass}
          autoComplete="on"
          onChange={handlePassChange}
        />
        <input type="submit" className="login__submit" value={"Войти"} />
      </form>
    </section>
  );
}
